func clipperToGraph(loops [][][]float64) [][][]float64 {
	var edges = make([][][]float64, 0)
	for i := 0; i < len(loops); i++ {
		var loop = loops[i]
		for j := 0; j < len(loop); j++ {
			var a = loop[j]
			var b = loop[(j+1)%len(loop)]
			if a[0] == b[0] && a[1] == b[1] {
				continue
			}
			edges = append(edges, [][]float64{{a[0], a[1]}, {b[0], b[1]}})
		}
	}
	return edges
}

