type Crossings [][]int

//Len for sort interface
func (o Crossings) Len() int {
	return len(o)
}

//Swap for sort interface
func (o Crossings) Swap(i, j int) {
	o[i], o[j] = o[j], o[i]
}

//lexical sort of x and y coordinates
func (o Crossings) Less(i, j int) bool {
	var x, y = 0, 1
	var a, b = o[i], o[j]
	var d = a[x] - b[x]

	//x's are close enough to each other
	if d == 0 {
		d = a[y] - b[y]
	} else {
		return d < 0
	}

	return d < 0
}

//Inplace Lexicographic sort
func (o Crossings) Sort() {
	sort.Sort(o)
}
